import '../css/forLogin.css'
import Axios from "axios";


const Login = () => {

    Axios.defaults.withCredentials = true;


      const loginFunc = () => {

        Axios.post('http://localhost:4000/login' , {mail:userMailLog , password:userPasswordLog})
            .then((response) => {

            if (response.data.message){

                console.log(response.data.message)
            }else{

                console.log(response.data)


            }
        })

      }


    return(
        <div>

            <div class="loginM">

                <div class="divI">
                    <h1 class="inf">Please Login to pass the CoronaVirus Test.</h1>
                </div>

                <div class="divH">  <h3 class="inf">I don't have an Account</h3> </div>


                <a class="signUp">Register</a>

            </div>


            <div class="login">

                <h1 class="loginT2">Login</h1>


            </div>

            <div className="form__group6 field">
                <input  autoComplete="off" type="input" className="form__field" placeholder="Email" name="email"
                       id='email' required/>
                <label htmlFor="email" className="form__label">Email</label>
            </div>


            <div className="form__group7 field">
                <input  autoComplete="off" type="password" className="form__field" placeholder="Password"
                       name="password" id='password' required/>
                <label htmlFor="password" className="form__label">Password</label>
            </div>



    <a onclick={loginFunc} class="signIn">Sign In</a>




        </div>
    );

}

export default Login;
